import React from "react";
import { useNavigate } from "react-router-dom";
import "./Doctordashboard.css"; // CSS for styling

const Doctordashboard = () => {
  const navigate = useNavigate(); // Navigation hook for routing
  const doctorName = "Dr. John Doe"; // Example doctor name

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>Doctor Panel</h2>
        <ul>
          <li onClick={() => navigate("/dashboard")}>Dashboard</li>
          <li onClick={() => navigate("/create-profile")}>Create Profile</li>
          <li onClick={() => navigate("/appointments")}>View Appointments</li>
          <li onClick={() => navigate("/availability")}>Availability</li>
          <li onClick={() => navigate("/settings")}>Settings</li>
          <li className="logout" onClick={() => navigate("/logout")}>
            Logout
          </li>
        </ul>
      </div>

      {/* Main Content with Banner */}
      <div className="main-content">
        <div className="banner">
          <h1>Welcome, {doctorName}!</h1>
        </div>
      </div>
    </div>
  );
};

export default Doctordashboard;
